I just ifnished watching the end of Stranger than Fiction.

I have no idea what this piece of writing means. I think it's really just one of the most seemless reflections of feelings that I've had in a while, but I can't seem to connect where all the dots are yet. It just sort of came to life and I felt very very compelled to write it.&nbsp;

Hopefully I get a new car tomorrow night, and this bloody weather realizes that it's spring.&nbsp;

I don't know what my deal has been lately.&nbsp;

Since I've been back I haven't been able to keep myself on a consistent level of functioning for more than a day or two. Last week I was just a slobbering mess of a person. I've been completely out of focus with a fucked up function. I feel like I'm walking around with some type of negative magnetic force that just disrupts whatever I come into contact with. I'm terribly behind on work, I keep pushing off seeing friends to get work done, I"ve been sick or feeling sick twice since I've been back&nbsp;and now I"ve gone and killed my car. I'm not really terribly upset, just sort of confused. I don't know what I'm doing wrong. I just feel completely and wholey not myself right now, it's rather disconserting. &nbsp;

On a positive note I"ve been all over getting things done today which has been great. It seems school never tires giving me late notice to do things that will eventually be a huge inconvience. I now have two big presentations to do for teachers and people. Brooklawn and Brown Scholars. I'll be lucky if Brown Scholars actually lets me do it considering how late I'm about to turn in material. Meh, they can get over it. They started with 35 my freshman year and now I'm sure we have about 7 left that will graduate with it.&nbsp;

Furthermore, I feel like I've been completely and totally helpless in terms of taking care of myself. I always find people making exceptions for me, helping me out, going out of their way so things will work for me. Why do I suck at this? I really just feel like I'm terrible&nbsp;at doing things for myself and making them work. I always seem to need someone to help me. This is something I really don't like about myself. I don't want to be helpless. It just kind of sucks.&nbsp;

What makes it worse is that I know I should not be bitching about my blessed existance. I should be insanely thankful, and I am. I just wish I could figure out what is making me feel so out of sorts lately. It just doesn't make sense.

I write this with the knowledge that I might sound like a self possessed, arrogant, presumtous fool...but hey, everyone gets one...or seven here or there, right? 

It's pretty pointless getting on here and trying to explain what happened while we were there. I can make all the facebook albums it takes to show the children that we played with, the living conditions that these people live in, or minute amount of work that we did trying to help the people in Zacapa have the oppurtunity for better life. I know this sounds bitter, but I remember all too well what it felt like coming from Sweden, not being able to express the things I experienced and falling back instead of the crazy stories from going out and getting plastered because that at least could be understood by the common college student. We didn't do any drinking on this trip. We got to swim a little in the pool at the hotel in the afternoons, we got to goof off, dance and have some fun, but it really doesn't paint a picture of what we were doing in a way that can be related too.&nbsp;

But I'll try...

Every day we got up at 630-700ish for breakfast, which would be over by 8. We would hop on the buses shortly afterwards and ride 45 minutes to our sit and start to work. During the morning the kids were in class (if the teachers were able to keep them there when they knew the "gringos" had arrived.) During those 5 days on the worksite, we built one puzzle piece mural, a boxed in play area for the kids, several wooden cut outs for decorations, laid out 4-15 tall, 15 foot across tracks of walls between the rooms, painted some down at the school, built 2-3 bookshelves, a few cribs, and maybe even more that I can't remember. We would finish around 4-5 and head back, and have about 2 hours of free time (most people used this to sleep out of exhaustion from 7-8 hours of exposure to 90-100 degree heat and humity. We spent part of one day at a hospital,(two girls helped deliver a baby c-section, how fucking cool is that? it made me want to be a doctor so I could do stuff like that!)&nbsp;another serving food at a garbage dump where people lived and a nutrion center for children that were malnorioused. (spelling?).&nbsp; Anyhow, we spent most of the time on site working and then a little free, good meals and lots of processing as a group where we were. on the site we were in two major work groups, one inside putting things together and another outside playing with the kids so they wouldn't sneak in and start playing around the power tools. I split my time between the two, not doing a lot after the jigsaw wasn't needed anymore.&nbsp;

Julie, Gabi, Manuel, Carlito, Darlene, Carlos, Axel, Jessica, Wendy, and so many others. I will never forget their smiling faces, the looks in their eyes when we gave them little treats or just took the time to pick them up and spin them around.&nbsp;Chingar mi, chingar mi still rings in my head as I think about them swarming around and speaking in the longforgotten spanish they know is beyond incomprehensible to me. 

So I went down and did some work, whats the big deal right? I realized that there is a good chance that I won't get into Grad school at this point and I've quite easily made my peace with that. I'm planning on taking next year off and looking for work in the humanitarian department. I'm going to fill out my Peace Corps Application this week and if things work with them, I very well do that type of work. I plan on learning Spanish any way I can in the next few months to secure a place in Central America or the Carribean. But these are just things I'm throwing out now. It's where I think I might end up. I want to be able to apply, get into and have finances convered for Grad school for International Development. I want to be able work with the giant organizations to make a change. Who knows where I would go from there.&nbsp;

Right now these are just dreams, ideas keeping me afloat after 10 days of losing my heart in Guatemala. I can't not do something after seeing these people. I don't know if this is going to be for me, or if it will work, but right now it's looking like the path that is closest to my heart, and thats what I've been chasing after all along.&nbsp;

Thanks for reading, and sorry if I'm not all myself. Like I said, I left my heart down there with the people, with the children and I hope to find a way to go back down and continue making a difference.

It's nights like tonight that make me wonder if I need to go back onto Lexapro. I don't understand how I can flip out with such incredible grace without running my car off the road. Tonight I actually hit the medium(no worries it was one of those little one foot ones, no car damage), which didn't do much to calm my nerves.&nbsp;

By the time I finally got home home I was exhausted with being angry and sad. Not as in bored, but physically exhausted with trying to maintain a state of anger or sadness as a means of supporting/pushing myself forward. I haven't decided if reaching that point is a good or bad thing.&nbsp;

I still wish I could muster the courage to just write an email and ask for a time. I have the courage to drive my car through a bloody blizzard while not being able to see the striped lines, while I am sick, but I'm too scared to sit down and let someone reflect the person I show them back at me. Again, not really sure how to feel, but I'm banking on sad for this one.&nbsp;

I fucking hate classes with descriptions that don't match the content. "exploring the universe" (in my mind) does not translate too lets figure out every aspect of the physics behind how the universe was created so that we can use the stars merely as references and examples for the mathmatical problems that will be presented on quizes and exams. Forgive me for thinking we might fucking explore a little bit as we went over these things. I guess as usual I misunderstood the information that was presented to me. I suppose it was just me putting my expectations of things on the language that was presented because it was what I wanted to hear. One of these days that'll get me killed. 

Fuck midterms, I'm so done with these classes.

&nbsp;Not only is this class a complete and total waste of my time. It cuts out on my sleep.&nbsp;

I learn nothing, I will probably fail the midterm, no one in the class understands this guy. He just punches through the math and assumes we understand. I fucking hate teachers like this. I thought this was going to have something to do with the solar system, not be entirely physics. I wouldn't have taken a class in physics. I almost failed it in high school. But no, it's all we focus on for the fucking class and every so often use a star as an example.&nbsp;

2 months and a week and I'm done with college and the dumb useless classes. It's almost a shame I took all the cool classes in the middle and have to take the rest of the random crap now.&nbsp;

I'm bringing mojitos to this midterm next week. I have no patience for this shit.&nbsp;

&nbsp;10 days!&nbsp;

I had stuff I wanted to write about, but I need to pay attention in class.&nbsp;

"Bigger is better" ---what the slide currently says as I look up...I think we are talking about telescopes.

I'm fairly certain that a number of things are crashing down&nbsp;around me. This would be a concern could I be on some form of routine right now, but everything seems to exist in static. I don't like this and I don't think it works well for me. However I can't shake the feeling that I'm letting people down every day. I just can't be everywhere at the&nbsp;same time. I can't raise my money for Guatemala, I can't spend&nbsp;enough time with the people I care about and I certainly don't&nbsp;see my&nbsp;family enough for living in their&nbsp;house.&nbsp;

I came to class 45 minutes late. I was up all night checking on Dan, because I was his DD for&nbsp;the night, and Devin and Corey got him completely shitfaced. I felt terrible for&nbsp;him and I'm really glad I was there to keep an eye on him. I wasn't overly worried though. I let him sleep in the bathroom of the suite for a while because I knew he would be ok. I'm getting better at this. I can't begin to say how happy I am about that.&nbsp;

But I'm still struggling and I feel like I"m running out of energy. I&nbsp;need all of these things going on in my life to end. When summer comes I need to&nbsp;NOT have projects, to not have obligations because right now I don't have time to breathe and doing one thing inevitably means having a bad time because I'm not doing something else with someone else. It leaves me unsatisfied more and more and it seems that my mind won't let anything slide without going a little crazy.&nbsp;

Part of me just wants to be away from this goddam town. I don't want to worry about any of it anymore, but I don't think it's in the cards. Too much of me wants to be here.&nbsp;&nbsp;

I don't fucking understand any of what this guy is talking about. Fuck it all, I'm so done with this.

Went t class and one of the girls bought me a fuze for no reason then I never had one before. Class was simple, got a muffian and didn't have to pay for it right away because i had misplaced my wallet. Got to play a few rounds of halo at home. Other class was easy. Went to work, got some free food. Activity went great. Basketball was fine, had dinner with jaana and we SPOKE SWEDISH!!!!! It was incredible, we almost had a complete fulblown conversation. We both realized we needed a little work. Played games with the guys until late. It was a pretty swell day overall. Oh! and no outing on saturday, horray!&nbsp;

In other news, I have letters to write as I"m still down 270 for Guatemala. But everything looks do-able now!

Running this morning, 4.5, puts me over the 60 mark in training

I'm not able to start this until now, about 10 till 9 so I don't have as much time to write. Prof is up there talking about light and such and for the most part I have been paying attention and trying to get everything done. Oh and the rain is falling again, which makes me feel so good... I wonder if dan is going to want to go running....

I'm pretty sure our country is utterly fucked. We've become so absorbed with our self possessed individualism that I fear it will come crashing down in short time. All people care about is personal recognition, being appreciated, desired, understood and given the personal attention that "they deserve" because being consciously aware means you are something of worth. This drives me fucking crazy, when people want recognition for simply being alive, not for doing something with their lives. I see it a lot in kids, not even at work but when I take them out places. Kids that don't care what they are doing, how they are acting or what their actions do to other people. "If it's not hurting me then whats the big deal". In fact I feel like once our kids at work reach a certain level they have a higher respect for this kind of stuff. Mainly because they REALLY know about pain and what it feels like, where so many others of us don't but think our middle or upper class lives have shown us some divine truth through the terrible struggles that come from living in such privledge. I do this too, which is why I get so incredibly angry when I'm in a bad mood. I get mad that I can't find happiness but have such a blessed life. I think about the people I'm going to see in Guatemala and I know now that my life is soooo much better off in terms of food, education, housing, and god forbib, even governmental support. Yet we bitch and complain and make a scene about our lives like it's something important in the grander scheme of things in the universe. People really need to fucking get over themselves. Seriously.

I'm thinking about the Peace Corp again. I don't know how serious about it I am but I plan on filling out the rest of the application and trying to see what I would be able to do. If I got placement somewhere in Central America or the Carribean I think I would be happy with it. Part of me really wants to go while part of me is petrified.&nbsp;

The rain stopped, but I did get to hear some thunder. Things seem almost to be organized to a T right now. I go through bi-polar stages of feeling organzied and feeling like the world is spinning out of control. I really don't like it. Most of it comes from people wanting me to do things though. The problem lies in me wanting to do them, but not always having time. I have too much experience of pissing people off to always say no. I feel like hal the time I have to say no I'm making someone mad. The most relaxing moments I have are when I can take all of an hour just playing halo without my phone going off, without being bothered or pestered and just let kill things. Why I find this thereputic, I don't know. Probably because it's the only thing I do for me now. Other then making the game for the boys, only because it stimulates my creativity and makes me think about the story that isn't on paper, and hasn't had time to be born there yet.&nbsp;

I might take the next class to try and write something on there, or maybe do my Peace Corp app, or finish whatever is needed for the UofL app., or make the bracelets for my friends, or.....there was something else, but I"ve forgotten it now. Maybe I'll actually pay attention....what a thought!

Just wanted to tell whoever is reading that I ran 7 miles today at 13.20 pace. Before today I couldn't run more than 3 straight. Whooo hooo to breaking thresholds!!! 

Be proud!&nbsp;

PS- I'm finally thinking that I can pull everything off I'm setting to do this semester!!

SO I got my plane ticket today. happiness

in other news.&nbsp;in order to have something cool happen, something horrible must follow. So of course, just as I finish with the plane ticket, I get bitched at my mom about not spending time with the family. We haven't had a fight since last year at this time. impressive.&nbsp;

There is yet another reason I want to get away. It's all fucking expectations and this belief that I have to do everything and nothing is every fucking good enough. I'm so sick of being here and I already haven't moved back home.&nbsp;

SO fuck life, I'm upset I have a stupid fucking in-service later tonight and I haven't started studying for my german final which is tom.&nbsp;

God dammit, why can't things just go nicely for a week. Please.
